CREATE FUNCTION gestmusica.fecha_crosstab(start_date date, end_date date) RETURNS text[]
    LANGUAGE plpgsql
    AS $$
DECLARE
  dates text[];
  i integer := 1;
BEGIN
  WHILE start_date <= end_date LOOP
    dates[i] := to_char(start_date, 'YYYY-MM-DD');
    start_date := start_date + INTERVAL '1 DAY';
    i := i + 1;
  END LOOP;
  RETURN dates;
END;
$$;


